/* VCD dumping functions */
MOD_mkHardwareTestBench & mkHardwareTestBench_backing(tSimStateHdl simHdl)
{
  static MOD_mkHardwareTestBench *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkHardwareTestBench(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkHardwareTestBench::dump_VCD_defs()
{
  (mkHardwareTestBench_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkHardwareTestBench::dump_VCD(tVCDDumpType dt)
{
  (mkHardwareTestBench_instance->dump_VCD)(dt,
					   vcd_depth(sim_hdl),
					   mkHardwareTestBench_backing(sim_hdl));
}
